import React, { useState } from "react";
import { Button} from "react-native";

const MainScreen = ({ navigation }) => {
    return (
      <Button
        title="Go to Jane's profile"
        onPress={() =>
          navigation.navigate('Profile', { name: 'Jane' })
        }
      />
    );
  };

export default MainScreen;
